const user = {
  name: "Leo Messi",
  imageUrl:
    "https://img.a.transfermarkt.technology/portrait/big/28003-1694590254.jpg?lm=1",
  imageSize: 90,
};

export default function Profile() {
  return (
    <>
      <h1>{user.name}</h1>
      <img
        className="avatar"
        src={user.imageUrl}
        alt={"Photo of " + user.name}
        style={{
          width: user.imageSize,
          height: user.imageSize,
        }}
      />
    </>
  );
}
